    private void reverse(byte[] byteArray, int beginningIndex, int endIndex) {
        while (true) {
            byte byteBeginning = byteArray[beginningIndex];
            if (byteBeginning == '\n') {
                byteBeginning = byteArray[++beginningIndex];
            }
            byte byteEnding = byteArray[endIndex];
            if (byteEnding == '\n') {
                byteEnding = byteArray[--endIndex];
            }
            if (beginningIndex > endIndex) {
                break;
            }
            byteArray[beginningIndex++] = map[byteEnding];
            byteArray[endIndex--] = map[byteBeginning];
        }
    }

